INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000003', 'reproduction', '"The production of new individuals that contain some portion of genetic material inherited from one or more parent organisms." [GOC:go_curators, GOC:isa_complete, GOC:jl, ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000082', 'G1/S transition of mitotic cell cycle', '"The mitotic cell cycle transition by which a cell in G1 commits to S phase. The process begins with the build up of G1 cyclin-dependent kinase (G1 CDK), resulting in the activation of transcription of G1 cyclins. The process ends with the positive feedback of the G1 cyclins on the G1 CDK which commits the cell to S phase, in which DNA replication is initiated." [GOC:mtg_cell_cycle]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000086', 'G2/M transition of mitotic cell cycle', '"The mitotic cell cycle transition by which a cell in G2 commits to M phase. The process begins when the kinase activity of M cyclin/CDK complex reaches a threshold high enough for the cell cycle to proceed. This is accomplished by activating a positive feedback loop that results in the accumulation of unphosphorylated and active M cyclin/CDK complex." [GOC:mtg_cell_cycle]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000122', 'negative regulation of transcription from RNA polymerase II promoter', '"Any process that stops, prevents, or reduces the frequency, rate or extent of transcription from an RNA polymerase II promoter." [GOC:go_curators, GOC:txnOH]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000184', 'nuclear-transcribed mRNA catabolic process, nonsense-mediated decay', '"The nonsense-mediated decay pathway for nuclear-transcribed mRNAs degrades mRNAs in which an amino-acid codon has changed to a nonsense codon; this prevents the translation of such mRNAs into truncated, and potentially harmful, proteins." [GOC:krc, GOC:ma, PMID:10025395]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000209', 'protein polyubiquitination', '"Addition of multiple ubiquitin groups to a protein, forming a ubiquitin chain." [ISBN:0815316194]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000278', 'mitotic cell cycle', '"Progression through the phases of the mitotic cell cycle, the most common eukaryotic cell cycle, which canonically comprises four successive phases called G1, S, G2, and M and includes replication of the genome and the subsequent segregation of chromosomes into daughter cells. In some variant cell cycles nuclear replication or nuclear division may not be followed by cell division, or G1 and G2 phases may be absent." [GOC:mah, ISBN:0815316194, Reactome:69278]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000280', 'nuclear division', '"The division of a cell nucleus into two nuclei, with DNA and other nuclear contents distributed between the daughter nuclei." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000375', 'RNA splicing, via transesterification reactions', '"Splicing of RNA via a series of two transesterification reactions." [GOC:krc]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000377', 'RNA splicing, via transesterification reactions with bulged adenosine as nucleophile', '"Splicing of RNA via a series of two transesterification reactions with a bulged adenosine residue from the intron branch point as the initiating nucleophile. When the initial RNA for the splicing reaction is a single molecule (cis splicing), the excised intron is released in a lariat structure." [GOC:krc, PMID:11377794]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000398', 'mRNA splicing, via spliceosome', '"The joining together of exons from one or more primary transcripts of messenger RNA (mRNA) and the excision of intron sequences, via a spliceosomal mechanism, so that mRNA consisting only of the joined exons is produced." [GOC:krc, ISBN:0198506732, ISBN:0879695897]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000902', 'cell morphogenesis', '"The developmental process in which the size or shape of a cell is generated and organized." [GOC:clt, GOC:dph, GOC:go_curators, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000904', 'cell morphogenesis involved in differentiation', '"The change in form (cell shape and size) that occurs when relatively unspecialized cells, e.g. embryonic or regenerative cells, acquire specialized structural and/or functional features that characterize the cells, tissues, or organs of the mature organism or some other relatively stable phase of the organism''s life history." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0000956', 'nuclear-transcribed mRNA catabolic process', '"The chemical reactions and pathways resulting in the breakdown of nuclear-transcribed mRNAs in eukaryotic cells." [GOC:krc]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0001525', 'angiogenesis', '"Blood vessel formation when new vessels emerge from the proliferation of pre-existing blood vessels." [ISBN:0878932453]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0001568', 'blood vessel development', '"The process whose specific outcome is the progression of a blood vessel over time, from its formation to the mature structure. The blood vessel is the vasculature carrying blood." [GOC:hjd, UBERON:0001981]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0001666', 'response to hypoxia', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus indicating lowered oxygen tension. Hypoxia, defined as a decline in O2 levels below normoxic levels of 20.8 - 20.95%, results in metabolic adaptation at both the cellular and organismal level." [GOC:hjd]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0001944', 'vasculature development', '"The process whose specific outcome is the progression of the vasculature over time, from its formation to the mature structure. The vasculature is an interconnected tubular multi-tissue structure that contains fluid that is actively transported around the organism." [GOC:dph, UBERON:0002409]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0002237', 'response to molecule of bacterial origin', '"Any process that results in a change in state or activity of an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus by molecules of bacterial origin such as peptides derived from bacterial flagellin." [GOC:rl, GOC:sm]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0002376', 'immune system process', '"Any process involved in the development or functioning of the immune system, an organismal system for calibrated responses to potential internal or invasive threats." [GO_REF:0000022, GOC:add, GOC:mtg_15nov05]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0003008', 'system process', '"A multicellular organismal process carried out by any of the organs or tissues in an organ system. An organ system is a regularly interacting or interdependent group of organs or tissues that work together to carry out a biological objective." [GOC:mtg_cardio]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006139', 'nucleobase-containing compound metabolic process', '"Any cellular metabolic process involving nucleobases, nucleosides, nucleotides and nucleic acids." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006259', 'DNA metabolic process', '"Any cellular metabolic process involving deoxyribonucleic acid. This is one of the two main types of nucleic acid, consisting of a long, unbranched macromolecule formed from one, or more commonly, two, strands of linked deoxyribonucleotides." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006260', 'DNA replication', '"The cellular metabolic process in which a cell duplicates one or more molecules of DNA. DNA replication begins when specific sequences, known as origins of replication, are recognized and bound by initiation proteins, and ends when the original DNA molecule has been completely duplicated and the copies topologically separated. The unit of replication usually corresponds to the genome of the cell, an organelle, or a virus. The template for replication can either be an existing DNA molecule or RNA." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006281', 'DNA repair', '"The process of restoring DNA after damage. Genomes are subject to damage by chemical and physical agents in the environment (e.g. UV and ionizing radiations, chemical mutagens, fungal and bacterial toxins, etc.) and by free radicals or alkylating agents endogenously generated in metabolism. DNA is also damaged because of errors during its replication. A variety of different DNA repair pathways have been reported that include direct reversal, base excision repair, nucleotide excision repair, photoreactivation, bypass, double-strand break repair pathway, and mismatch repair pathway." [PMID:11563486]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006351', 'transcription, DNA-templated', '"The cellular synthesis of RNA on a template of DNA." [GOC:jl, GOC:txnOH]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006352', 'DNA-templated transcription, initiation', '"Any process involved in the assembly of the RNA polymerase preinitiation complex (PIC) at the core promoter region of a DNA template, resulting in the subsequent synthesis of RNA from that promoter. The initiation phase includes PIC assembly and the formation of the first few bonds in the RNA chain, including abortive initiation, which occurs when the first few nucleotides are repeatedly synthesized and then released. The initiation phase ends just before and does not include promoter clearance, or release, which is the transition between the initiation and elongation phases of transcription." [GOC:jid, GOC:txnOH, PMID:18280161]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006355', 'regulation of transcription, DNA-templated', '"Any process that modulates the frequency, rate or extent of cellular DNA-templated transcription." [GOC:go_curators, GOC:txnOH]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006357', 'regulation of transcription from RNA polymerase II promoter', '"Any process that modulates the frequency, rate or extent of transcription from an RNA polymerase II promoter." [GOC:go_curators, GOC:txnOH]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006366', 'transcription from RNA polymerase II promoter', '"The synthesis of RNA from a DNA template by RNA polymerase II, originating at an RNA polymerase II promoter. Includes transcription of messenger RNA (mRNA) and certain small nuclear RNAs (snRNAs)." [GOC:jl, GOC:txnOH, ISBN:0321000382]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006367', 'transcription initiation from RNA polymerase II promoter', '"Any process involved in the assembly of the RNA polymerase II preinitiation complex (PIC) at an RNA polymerase II promoter region of a DNA template, resulting in the subsequent synthesis of RNA from that promoter. The initiation phase includes PIC assembly and the formation of the first few bonds in the RNA chain, including abortive initiation, which occurs when the first few nucleotides are repeatedly synthesized and then released. Promoter clearance, or release, is the transition between the initiation and elongation phases of transcription." [GOC:mah, GOC:txnOH]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006396', 'RNA processing', '"Any process involved in the conversion of one or more primary RNA transcripts into one or more mature RNA molecules." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006397', 'mRNA processing', '"Any process involved in the conversion of a primary mRNA transcript into one or more mature mRNA(s) prior to translation into polypeptide." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006401', 'RNA catabolic process', '"The chemical reactions and pathways resulting in the breakdown of RNA, ribonucleic acid, one of the two main type of nucleic acid, consisting of a long, unbranched macromolecule formed from ribonucleotides joined in 3'',5''-phosphodiester linkage." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006402', 'mRNA catabolic process', '"The chemical reactions and pathways resulting in the breakdown of mRNA, messenger RNA, which is responsible for carrying the coded genetic ''message'', transcribed from DNA, to sites of protein assembly at the ribosomes." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006412', 'translation', '"The cellular metabolic process in which a protein is formed, using the sequence of a mature mRNA molecule to specify the sequence of amino acids in a polypeptide chain. Translation is mediated by the ribosome, and begins with the formation of a ternary complex between aminoacylated initiator methionine tRNA, GTP, and initiation factor 2, which subsequently associates with the small subunit of the ribosome and an mRNA. Translation ends with the release of a polypeptide chain from the ribosome." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006413', 'translational initiation', '"The process preceding formation of the peptide bond between the first two amino acids of a protein. This includes the formation of a complex of the ribosome, mRNA, and an initiation complex that contains the first aminoacyl-tRNA." [ISBN:019879276X]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006414', 'translational elongation', '"The successive addition of amino acid residues to a nascent polypeptide chain during protein biosynthesis." [GOC:ems]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006457', 'protein folding', '"The process of assisting in the covalent and noncovalent assembly of single chain polypeptides or multisubunit complexes into the correct tertiary structure." [GOC:go_curators, GOC:rb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006461', 'protein complex assembly', '"The aggregation, arrangement and bonding together of a set of components to form a protein complex." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006464', 'cellular protein modification process', '"The covalent alteration of one or more amino acids occurring in proteins, peptides and nascent polypeptides (co-translational, post-translational modifications) occurring at the level of an individual cell. Includes the modification of charged tRNAs that are destined to occur in a protein (pre-translation modification)." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006468', 'protein phosphorylation', '"The process of introducing a phosphate group on to a protein." [GOC:hb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006470', 'protein dephosphorylation', '"The process of removing one or more phosphoric residues from a protein." [GOC:hb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006508', 'proteolysis', '"The hydrolysis of proteins into smaller polypeptides and/or amino acids by cleavage of their peptide bonds." [GOC:bf, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006518', 'peptide metabolic process', '"The chemical reactions and pathways involving peptides, compounds of two or more amino acids where the alpha carboxyl group of one is bound to the alpha amino group of another." [CHEBI:16670, GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006605', 'protein targeting', '"The process of targeting specific proteins to particular membrane-bounded subcellular organelles. Usually requires an organelle specific protein sequence motif." [GOC:ma]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006612', 'protein targeting to membrane', '"The process of directing proteins towards a membrane, usually using signals contained within the protein." [GOC:curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006613', 'cotranslational protein targeting to membrane', '"The targeting of proteins to a membrane that occurs during translation. The transport of most secretory proteins, particularly those with more than 100 amino acids, into the endoplasmic reticulum lumen occurs in this manner, as does the import of some proteins into mitochondria." [ISBN:0716731363, PMID:10512867, PMID:16896215]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006614', 'SRP-dependent cotranslational protein targeting to membrane', '"The targeting of proteins to a membrane that occurs during translation and is dependent upon two key components, the signal-recognition particle (SRP) and the SRP receptor. SRP is a cytosolic particle that transiently binds to the endoplasmic reticulum (ER) signal sequence in a nascent protein, to the large ribosomal unit, and to the SRP receptor in the ER membrane." [ISBN:0716731363]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006725', 'cellular aromatic compound metabolic process', '"The chemical reactions and pathways involving aromatic compounds, any organic compound characterized by one or more planar rings, each of which contains conjugated double bonds and delocalized pi electrons, as carried out by individual cells." [GOC:ai, ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006793', 'phosphorus metabolic process', '"The chemical reactions and pathways involving the nonmetallic element phosphorus or compounds that contain phosphorus, usually in the form of a phosphate group (PO4)." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006796', 'phosphate-containing compound metabolic process', '"The chemical reactions and pathways involving the phosphate group, the anion or salt of any phosphoric acid." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006807', 'nitrogen compound metabolic process', '"The chemical reactions and pathways involving organic or inorganic compounds that contain nitrogen, including (but not limited to) nitrogen fixation, nitrification, denitrification, assimilatory/dissimilatory nitrate reduction and the interconversion of nitrogenous organic matter and ammonium." [CHEBI:51143, GOC:go_curators, GOC:jl, ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006810', 'transport', '"The directed movement of substances (such as macromolecules, small molecules, ions) into, out of or within a cell, or between cells, or within a multicellular organism by means of some agent such as a transporter or pore." [GOC:dph, GOC:jl, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006811', 'ion transport', '"The directed movement of charged atoms or small charged molecules into, out of or within a cell, or between cells, by means of some agent such as a transporter or pore." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006812', 'cation transport', '"The directed movement of cations, atoms or small molecules with a net positive charge, into, out of or within a cell, or between cells, by means of some agent such as a transporter or pore." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006814', 'sodium ion transport', '"The directed movement of sodium ions (Na+) into, out of or within a cell, or between cells, by means of some agent such as a transporter or pore." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006886', 'intracellular protein transport', '"The directed movement of proteins in a cell, including the movement of proteins between specific compartments or structures within a cell, such as organelles of a eukaryotic cell." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006915', 'apoptotic process', '"A programmed cell death process which begins when a cell receives an internal (e.g. DNA damage) or external signal (e.g. an extracellular death ligand), and proceeds through a series of biochemical events (signaling pathway phase) which trigger an execution phase. The execution phase is the last step of an apoptotic process, and is typically characterized by rounding-up of the cell, retraction of pseudopodes, reduction of cellular volume (pyknosis), chromatin condensation, nuclear fragmentation (karyorrhexis), plasma membrane blebbing and fragmentation of the cell into apoptotic bodies. When the execution phase is completed, the cell has died." [GOC:cjm, GOC:dhl, GOC:ecd, GOC:go_curators, GOC:mtg_apoptosis, GOC:tb, ISBN:0198506732, PMID:18846107, PMID:21494263]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006928', 'movement of cell or subcellular component', '"The directed, self-propelled movement of a cell or subcellular component without the involvement of an external agent such as a transporter or a pore." [GOC:dgh, GOC:dph, GOC:jl, GOC:mlg]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006935', 'chemotaxis', '"The directed movement of a motile cell or organism, or the directed growth of a cell guided by a specific chemical concentration gradient. Movement may be towards a higher concentration (positive chemotaxis) or towards a lower concentration (negative chemotaxis)." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006950', 'response to stress', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a disturbance in organismal or cellular homeostasis, usually, but not necessarily, exogenous (e.g. temperature, humidity, ionizing radiation)." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006952', 'defense response', '"Reactions, triggered in response to the presence of a foreign body or the occurrence of an injury, which result in restriction of damage to the organism attacked or prevention/recovery from the infection caused by the attack." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006955', 'immune response', '"Any immune system process that functions in the calibrated response of an organism to a potential internal or invasive threat." [GO_REF:0000022, GOC:add, GOC:mtg_15nov05]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006974', 'cellular response to DNA damage stimulus', '"Any process that results in a change in state or activity of a cell (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus indicating damage to its DNA from environmental insults or errors during metabolism." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006979', 'response to oxidative stress', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of oxidative stress, a state often resulting from exposure to high levels of reactive oxygen species, e.g. superoxide anions, hydrogen peroxide (H2O2), and hydroxyl radicals." [GOC:jl, PMID:12115731]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0006996', 'organelle organization', '"A process that is carried out at the cellular level which results in the assembly, arrangement of constituent parts, or disassembly of an organelle within a cell. An organelle is an organized structure of distinctive morphology and function. Includes the nucleus, mitochondria, plastids, vacuoles, vesicles, ribosomes and the cytoskeleton. Excludes the plasma membrane." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007017', 'microtubule-based process', '"Any cellular process that depends upon or alters the microtubule cytoskeleton, that part of the cytoskeleton comprising microtubules and their associated proteins." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007018', 'microtubule-based movement', '"A microtubule-based process that is mediated by motor proteins and results in the movement of organelles, other microtubules, or other particles along microtubules." [GOC:cjm, ISBN:0815316194]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007049', 'cell cycle', '"The progression of biochemical and morphological phases and events that occur in a cell during successive cell replication or nuclear replication events. Canonically, the cell cycle comprises the replication and segregation of genetic material followed by the division of the cell, but in endocycles or syncytial cells nuclear replication or nuclear division may not be followed by cell division." [GOC:go_curators, GOC:mtg_cell_cycle]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007067', 'mitotic nuclear division', '"A cell cycle process comprising the steps by which the nucleus of a eukaryotic cell divides; the process involves condensation of chromosomal DNA into a highly compacted form. Canonically, mitosis produces two daughter nuclei whose chromosome complement is identical to that of the mother cell." [GOC:dph, GOC:ma, GOC:mah, ISBN:0198547684]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007154', 'cell communication', '"Any process that mediates interactions between a cell and its surroundings. Encompasses interactions such as signaling or attachment between one cell and another cell, between a cell and an extracellular matrix, or between a cell and any other aspect of its environment." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007155', 'cell adhesion', '"The attachment of a cell, either to another cell or to an underlying substrate such as the extracellular matrix, via cell adhesion molecules." [GOC:hb, GOC:pf]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007165', 'signal transduction', '"The cellular process in which a signal is conveyed to trigger a change in the activity or state of a cell. Signal transduction begins with reception of a signal (e.g. a ligand binding to a receptor or receptor activation by a stimulus such as light), or for signal transduction in the absence of ligand, signal-withdrawal or the activity of a constitutively active receptor. Signal transduction ends with regulation of a downstream cellular process, e.g. regulation of transcription or regulation of a metabolic process. Signal transduction covers signaling from receptors located on the surface of the cell and signaling via molecules located within the cell. For signaling between cells, signal transduction is restricted to events at and within the receiving cell." [GOC:go_curators, GOC:mtg_signaling_feb11]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007166', 'cell surface receptor signaling pathway', '"A series of molecular signals initiated by activation of a receptor on the surface of a cell. The pathway begins with binding of an extracellular ligand to a cell surface receptor, or for receptors that signal in the absence of a ligand, by ligand-withdrawal or the activity of a constitutively active receptor. The pathway ends with regulation of a downstream cellular process, e.g. transcription." [GOC:bf, GOC:mah, GOC:pr, GOC:signaling]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007186', 'G-protein coupled receptor signaling pathway', '"A series of molecular signals that proceeds with an activated receptor promoting the exchange of GDP for GTP on the alpha-subunit of an associated heterotrimeric G-protein complex. The GTP-bound activated alpha-G-protein then dissociates from the beta- and gamma-subunits to further transmit the signal within the cell. The pathway begins with receptor-ligand interaction, or for basal GPCR signaling the pathway begins with the receptor activating its G protein in the absence of an agonist, and ends with regulation of a downstream cellular process, e.g. transcription.  The pathway can start from the plasma membrane, Golgi or nuclear membrane (PMID:24568158 and PMID:16902576)." [GOC:bf, GOC:mah, PMID:16902576PMID\:24568158, Wikipedia:G_protein-coupled_receptor]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007219', 'Notch signaling pathway', '"A series of molecular signals initiated by the binding of an extracellular ligand to the receptor Notch on the surface of a target cell, and ending with regulation of a downstream cellular process, e.g. transcription." [GOC:go_curators, GOC:signaling]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007264', 'small GTPase mediated signal transduction', '"Any series of molecular signals in which a small monomeric GTPase relays one or more of the signals." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007267', 'cell-cell signaling', '"Any process that mediates the transfer of information from one cell to another." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007268', 'synaptic transmission', '"The process of communication from a neuron to a target (neuron, muscle, or secretory cell) across a synapse." [GOC:jl, MeSH:D009435]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007275', 'multicellular organismal development', '"The biological process whose specific outcome is the progression of a multicellular organism over time from an initial condition (e.g. a zygote or a young adult) to a later condition (e.g. a multicellular animal or an aged adult)." [GOC:dph, GOC:ems, GOC:isa_complete, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007276', 'gamete generation', '"The generation and maintenance of gametes in a multicellular organism. A gamete is a haploid reproductive cell." [GOC:ems, GOC:mtg_sensu]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007283', 'spermatogenesis', '"The process of formation of spermatozoa, including spermatocytogenesis and spermiogenesis." [GOC:jid, ISBN:9780878933846]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007399', 'nervous system development', '"The process whose specific outcome is the progression of nervous tissue over time, from its formation to its mature state." [GOC:dgh]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007409', 'axonogenesis', '"De novo generation of a long process of a neuron, that carries efferent (outgoing) action potentials from the cell body towards target cells. Refers to the morphogenesis or creation of shape or form of the developing axon." [GOC:dph, GOC:jid, GOC:pg, GOC:pr, ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007411', 'axon guidance', '"The chemotaxis process that directs the migration of an axon growth cone to a specific target site in response to a combination of attractive and repulsive cues." [ISBN:0878932437]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007417', 'central nervous system development', '"The process whose specific outcome is the progression of the central nervous system over time, from its formation to the mature structure. The central nervous system is the core nervous system that serves an integrating and coordinating function. In vertebrates it consists of the brain and spinal cord. In those invertebrates with a central nervous system it typically consists of a brain, cerebral ganglia and a nerve cord." [GOC:bf, GOC:jid, ISBN:0582227089]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007420', 'brain development', '"The process whose specific outcome is the progression of the brain over time, from its formation to the mature structure. Brain development begins with patterning events in the neural tube and ends with the mature structure that is the center of thought and emotion. The brain is responsible for the coordination and control of bodily activities and the interpretation of information from the senses (sight, hearing, smell, etc.)." [GOC:dph, GOC:jid, GOC:tb, UBERON:0000955]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007507', 'heart development', '"The process whose specific outcome is the progression of the heart over time, from its formation to the mature structure. The heart is a hollow, muscular organ, which, by contracting rhythmically, keeps up the circulation of the blood." [GOC:jid, UBERON:0000948]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007596', 'blood coagulation', '"The sequential process in which the multiple coagulation factors of the blood interact, ultimately resulting in the formation of an insoluble fibrin clot; it may be divided into three stages: stage 1, the formation of intrinsic and extrinsic prothrombin converting principle; stage 2, the formation of thrombin; stage 3, the formation of stable fibrin polymers." [http://www.graylab.ac.uk/omd/, ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007599', 'hemostasis', '"The stopping of bleeding (loss of body fluid) or the arrest of the circulation to an organ or part." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007600', 'sensory perception', '"The series of events required for an organism to receive a sensory stimulus, convert it to a molecular signal, and recognize and characterize the signal. This is a neurological process." [GOC:ai, GOC:dph]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007601', 'visual perception', '"The series of events required for an organism to receive a visual stimulus, convert it to a molecular signal, and recognize and characterize the signal. Visual stimuli are detected in the form of photons and are processed to form an image." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0007605', 'sensory perception of sound', '"The series of events required for an organism to receive an auditory stimulus, convert it to a molecular signal, and recognize and characterize the signal. Sonic stimuli are detected in the form of vibrations and are processed to form a sound." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0008104', 'protein localization', '"Any process in which a protein is transported to, or maintained in, a specific location." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0008150', 'biological_process', '"Any process specifically pertinent to the functioning of integrated living units: cells, tissues, organs, and organisms. A process is a collection of molecular events with a defined beginning and end." [GOC:go_curators, GOC:isa_complete]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0008152', 'metabolic process', '"The chemical reactions and pathways, including anabolism and catabolism, by which living organisms transform chemical substances. Metabolic processes typically transform small molecules, but also include macromolecular processes such as DNA repair and replication, and protein synthesis and degradation." [GOC:go_curators, ISBN:0198547684]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0008219', 'cell death', '"Any biological process that results in permanent cessation of all vital functions of a cell. A cell should be considered dead when any one of the following molecular or morphological criteria is met: (1) the cell has lost the integrity of its plasma membrane; (2) the cell, including its nucleus, has undergone complete fragmentation into discrete bodies (frequently referred to as \"apoptotic bodies\"); and/or (3) its corpse (or its fragments) have been engulfed by an adjacent cell in vivo." [GOC:mah, GOC:mtg_apoptosis]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0008283', 'cell proliferation', '"The multiplication or reproduction of cells, resulting in the expansion of a cell population." [GOC:mah, GOC:mb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0008284', 'positive regulation of cell proliferation', '"Any process that activates or increases the rate or extent of cell proliferation." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0008285', 'negative regulation of cell proliferation', '"Any process that stops, prevents or reduces the rate or extent of cell proliferation." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0008380', 'RNA splicing', '"The process of removing sections of the primary RNA transcript to remove sequences not present in the mature form of the RNA and joining the remaining sections to form the mature form of the RNA." [GOC:krc, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009056', 'catabolic process', '"The chemical reactions and pathways resulting in the breakdown of substances, including the breakdown of carbon compounds with the liberation of energy for use by the cell or organism." [ISBN:0198547684]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009057', 'macromolecule catabolic process', '"The chemical reactions and pathways resulting in the breakdown of a macromolecule, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass." [CHEBI:33694, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009058', 'biosynthetic process', '"The chemical reactions and pathways resulting in the formation of substances; typically the energy-requiring part of metabolism in which simpler substances are transformed into more complex ones." [GOC:curators, ISBN:0198547684]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009059', 'macromolecule biosynthetic process', '"The chemical reactions and pathways resulting in the formation of a macromolecule, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass." [CHEBI:33694, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009605', 'response to external stimulus', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of an external stimulus." [GOC:hb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009607', 'response to biotic stimulus', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a biotic stimulus, a stimulus caused or produced by a living organism." [GOC:hb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009611', 'response to wounding', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus indicating damage to the organism." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009617', 'response to bacterium', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus from a bacterium." [GOC:hb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009628', 'response to abiotic stimulus', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of an abiotic (non-living) stimulus." [GOC:hb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009653', 'anatomical structure morphogenesis', '"The process in which anatomical structures are generated and organized. Morphogenesis pertains to the creation of form." [GOC:go_curators, ISBN:0521436125]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009889', 'regulation of biosynthetic process', '"Any process that modulates the frequency, rate or extent of the chemical reactions and pathways resulting in the formation of substances." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009890', 'negative regulation of biosynthetic process', '"Any process that stops, prevents, or reduces the rate of the chemical reactions and pathways resulting in the formation of substances." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009891', 'positive regulation of biosynthetic process', '"Any process that activates or increases the frequency, rate or extent of the chemical reactions and pathways resulting in the formation of substances." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009892', 'negative regulation of metabolic process', '"Any process that stops, prevents, or reduces the frequency, rate or extent of the chemical reactions and pathways within a cell or an organism." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009893', 'positive regulation of metabolic process', '"Any process that activates or increases the frequency, rate or extent of the chemical reactions and pathways within a cell or an organism." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009966', 'regulation of signal transduction', '"Any process that modulates the frequency, rate or extent of signal transduction." [GOC:sm]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009967', 'positive regulation of signal transduction', '"Any process that activates or increases the frequency, rate or extent of signal transduction." [GOC:sm]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009968', 'negative regulation of signal transduction', '"Any process that stops, prevents, or reduces the frequency, rate or extent of signal transduction." [GOC:sm]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0009987', 'cellular process', '"Any process that is carried out at the cellular level, but not necessarily restricted to a single cell. For example, cell communication occurs among more than one cell, but occurs at the cellular level." [GOC:go_curators, GOC:isa_complete]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010033', 'response to organic substance', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of an organic substance stimulus." [GOC:sm]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010467', 'gene expression', '"The process in which a gene''s sequence is converted into a mature gene product or products (proteins or RNA). This includes the production of an RNA transcript as well as any processing to produce a mature RNA product or an mRNA (for protein-coding genes) and the translation of that mRNA into protein. Protein maturation is included when required to form an active form of a product from an inactive precursor form." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010468', 'regulation of gene expression', '"Any process that modulates the frequency, rate or extent of gene expression. Gene expression is the process in which a gene''s coding sequence is converted into a mature gene product or products (proteins or RNA). This includes the production of an RNA transcript as well as any processing to produce a mature RNA product or an mRNA (for protein-coding genes) and the translation of that mRNA into protein. Protein maturation is included when required to form an active form of a product from an inactive precursor form." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010556', 'regulation of macromolecule biosynthetic process', '"Any process that modulates the rate, frequency or extent of the chemical reactions and pathways resulting in the formation of a macromolecule, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010557', 'positive regulation of macromolecule biosynthetic process', '"Any process that increases the rate, frequency or extent of the chemical reactions and pathways resulting in the formation of a macromolecule, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010558', 'negative regulation of macromolecule biosynthetic process', '"Any process that decreases the rate, frequency or extent of the chemical reactions and pathways resulting in the formation of a macromolecule, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010604', 'positive regulation of macromolecule metabolic process', '"Any process that increases the frequency, rate or extent of the chemical reactions and pathways involving macromolecules, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010605', 'negative regulation of macromolecule metabolic process', '"Any process that decreases the frequency, rate or extent of the chemical reactions and pathways involving macromolecules, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010628', 'positive regulation of gene expression', '"Any process that increases the frequency, rate or extent of gene expression. Gene expression is the process in which a gene''s coding sequence is converted into a mature gene product or products (proteins or RNA). This includes the production of an RNA transcript as well as any processing to produce a mature RNA product or an mRNA (for protein-coding genes) and the translation of that mRNA into protein. Protein maturation is included when required to form an active form of a product from an inactive precursor form." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010629', 'negative regulation of gene expression', '"Any process that decreases the frequency, rate or extent of gene expression. Gene expression is the process in which a gene''s coding sequence is converted into a mature gene product or products (proteins or RNA). This includes the production of an RNA transcript as well as any processing to produce a mature RNA product or an mRNA (for protein-coding genes) and the translation of that mRNA into protein. Protein maturation is included when required to form an active form of a product from an inactive precursor form." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010646', 'regulation of cell communication', '"Any process that modulates the frequency, rate or extent of cell communication. Cell communication is the process that mediates interactions between a cell and its surroundings. Encompasses interactions such as signaling or attachment between one cell and another cell, between a cell and an extracellular matrix, or between a cell and any other aspect of its environment." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010647', 'positive regulation of cell communication', '"Any process that increases the frequency, rate or extent of cell communication. Cell communication is the process that mediates interactions between a cell and its surroundings. Encompasses interactions such as signaling or attachment between one cell and another cell, between a cell and an extracellular matrix, or between a cell and any other aspect of its environment." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010648', 'negative regulation of cell communication', '"Any process that decreases the frequency, rate or extent of cell communication. Cell communication is the process that mediates interactions between a cell and its surroundings. Encompasses interactions such as signaling or attachment between one cell and another cell, between a cell and an extracellular matrix, or between a cell and any other aspect of its environment." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010927', 'cellular component assembly involved in morphogenesis', '"The cellular component assembly that is part of the initial shaping of the component during its developmental progression." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010941', 'regulation of cell death', '"Any process that modulates the rate or frequency of cell death. Cell death is the specific activation or halting of processes within a cell so that its vital functions markedly cease, rather than simply deteriorating gradually over time, which culminates in cell death." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0010942', 'positive regulation of cell death', '"Any process that increases the rate or frequency of cell death. Cell death is the specific activation or halting of processes within a cell so that its vital functions markedly cease, rather than simply deteriorating gradually over time, which culminates in cell death." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0012501', 'programmed cell death', '"A process which begins when a cell receives an internal or external signal and activates a series of biochemical events (signaling pathway). The process ends with the death of the cell." [GOC:lr, GOC:mtg_apoptosis]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0015031', 'protein transport', '"The directed movement of proteins into, out of or within a cell, or between cells, by means of some agent such as a transporter or pore." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0015672', 'monovalent inorganic cation transport', '"The directed movement of inorganic cations with a valency of one into, out of or within a cell, or between cells, by means of some agent such as a transporter or pore. Inorganic cations are atoms or small molecules with a positive charge which do not contain carbon in covalent linkage." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0016043', 'cellular component organization', '"A process that results in the assembly, arrangement of constituent parts, or disassembly of a cellular component." [GOC:ai, GOC:jl, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0016070', 'RNA metabolic process', '"The cellular chemical reactions and pathways involving RNA, ribonucleic acid, one of the two main type of nucleic acid, consisting of a long, unbranched macromolecule formed from ribonucleotides joined in 3'',5''-phosphodiester linkage." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0016071', 'mRNA metabolic process', '"The chemical reactions and pathways involving mRNA, messenger RNA, which is responsible for carrying the coded genetic ''message'', transcribed from DNA, to sites of protein assembly at the ribosomes." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0016265', 'death', '"A permanent cessation of all vital functions: the end of life; can be applied to a whole organism or to a part of an organism." [GOC:mah, GOC:mtg_apoptosis, ISBN:0877797099]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0016310', 'phosphorylation', '"The process of introducing a phosphate group into a molecule, usually with the formation of a phosphoric ester, a phosphoric anhydride or a phosphoric amide." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0016311', 'dephosphorylation', '"The process of removing one or more phosphoric (ester or anhydride) residues from a molecule." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0016477', 'cell migration', '"The controlled self-propelled movement of a cell from one site to a destination guided by molecular cues. Cell migration is a central process in the development and maintenance of multicellular organisms." [GOC:cjm, GOC:dph, GOC:ems, GOC:pf, http://en.wikipedia.org/wiki/Cell_migration]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0016482', 'cytoplasmic transport', '"The directed movement of substances (such as macromolecules, small molecules, ions) into, out of, or within the cytoplasm of a cell." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0016567', 'protein ubiquitination', '"The process in which one or more ubiquitin groups are added to a protein." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0018130', 'heterocycle biosynthetic process', '"The chemical reactions and pathways resulting in the formation of heterocyclic compounds, those with a cyclic molecular structure and at least two different atoms in the ring (or rings)." [ISBN:0198547684]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0019219', 'regulation of nucleobase-containing compound metabolic process', '"Any cellular process that modulates the frequency, rate or extent of the chemical reactions and pathways involving nucleobases, nucleosides, nucleotides and nucleic acids." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0019221', 'cytokine-mediated signaling pathway', '"A series of molecular signals initiated by the binding of a cytokine to a receptor on the surface of a cell, and ending with regulation of a downstream cellular process, e.g. transcription." [GOC:mah, GOC:signaling, PMID:19295629]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0019222', 'regulation of metabolic process', '"Any process that modulates the frequency, rate or extent of the chemical reactions and pathways within a cell or an organism." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0019438', 'aromatic compound biosynthetic process', '"The chemical reactions and pathways resulting in the formation of aromatic compounds, any substance containing an aromatic carbon ring." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0019439', 'aromatic compound catabolic process', '"The chemical reactions and pathways resulting in the breakdown of aromatic compounds, any substance containing an aromatic carbon ring." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0019538', 'protein metabolic process', '"The chemical reactions and pathways involving a specific protein, rather than of proteins in general. Includes protein modification." [GOC:ma]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0019953', 'sexual reproduction', '"A reproduction process that creates a new organism by combining the genetic material of two organisms. It occurs both in eukaryotes and prokaryotes: in multicellular eukaryotic organisms, an individual is created anew; in prokaryotes, the initial cell has additional or transformed genetic material. In a process called genetic recombination, genetic material (DNA) originating from two different individuals (parents) join up so that homologous sequences are aligned with each other, and this is followed by exchange of genetic information. After the new recombinant chromosome is formed, it is passed on to progeny." [GOC:jl, http://en.wikipedia.org/wiki/Sexual_reproduction, ISBN:0387520546]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0022008', 'neurogenesis', '"Generation of cells within the nervous system." [GO_REF:0000021, GOC:cls, GOC:curators, GOC:dgh, GOC:dph, GOC:jid, GOC:mtg_15jun06]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0022402', 'cell cycle process', '"The cellular process that ensures successive accurate and complete genome replication and chromosome segregation." [GOC:isa_complete, GOC:mtg_cell_cycle]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0022414', 'reproductive process', '"A biological process that directly contributes to the process of producing new individuals by one or two organisms. The new individuals inherit some proportion of their genetic material from the parent or parents." [GOC:dph, GOC:isa_complete]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0022607', 'cellular component assembly', '"The aggregation, arrangement and bonding together of a cellular component." [GOC:isa_complete]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0022610', 'biological adhesion', '"The attachment of a cell or organism to a substrate or other organism." [GOC:isa_complete]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0023051', 'regulation of signaling', '"Any process that modulates the frequency, rate or extent of a signaling process." [GOC:mtg_signal]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0023052', 'signaling', '"The entirety of a process in which information is transmitted within a biological system. This process begins with an active signal and ends when a cellular response has been triggered." [GOC:mtg_signal, GOC:mtg_signaling_feb11, GOC:signaling]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0023056', 'positive regulation of signaling', '"Any process that activates, maintains or increases the frequency, rate or extent of a signaling process." [GOC:mtg_signal]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0023057', 'negative regulation of signaling', '"Any process that stops, prevents, or reduces the frequency, rate or extent of a signaling process." [GOC:mtg_signal]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0030001', 'metal ion transport', '"The directed movement of metal ions, any metal ion with an electric charge, into, out of or within a cell, or between cells, by means of some agent such as a transporter or pore." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0030030', 'cell projection organization', '"A process that is carried out at the cellular level which results in the assembly, arrangement of constituent parts, or disassembly of a prolongation or process extending from a cell, e.g. a flagellum or axon." [GOC:jl, GOC:mah, http://www.cogsci.princeton.edu/~wn/]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0030031', 'cell projection assembly', '"Formation of a prolongation or process extending from a cell, e.g. a flagellum or axon." [GOC:jl, GOC:mah, http://www.cogsci.princeton.edu/~wn/]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0030111', 'regulation of Wnt signaling pathway', '"Any process that modulates the frequency, rate or extent of the activity of the Wnt signal transduction pathway." [GOC:dph, GOC:mah, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0030154', 'cell differentiation', '"The process in which relatively unspecialized cells, e.g. embryonic or regenerative cells, acquire specialized structural and/or functional features that characterize the cells, tissues, or organs of the mature organism or some other relatively stable phase of the organism''s life history. Differentiation includes the processes involved in commitment of a cell to a specific fate and its subsequent development to the mature state." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0030177', 'positive regulation of Wnt signaling pathway', '"Any process that activates or increases the frequency, rate or extent of Wnt signal transduction." [GOC:dph, GOC:go_curators, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0030178', 'negative regulation of Wnt signaling pathway', '"Any process that stops, prevents, or reduces the frequency, rate or extent of the Wnt signaling pathway." [GOC:dph, GOC:go_curators, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0030182', 'neuron differentiation', '"The process in which a relatively unspecialized cell acquires specialized features of a neuron." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0030198', 'extracellular matrix organization', '"A process that is carried out at the cellular level which results in the assembly, arrangement of constituent parts, or disassembly of an extracellular matrix." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0031175', 'neuron projection development', '"The process whose specific outcome is the progression of a neuron projection over time, from its formation to the mature structure. A neuron projection is any process extending from a neural cell, such as axons or dendrites (collectively called neurites)." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0031323', 'regulation of cellular metabolic process', '"Any process that modulates the frequency, rate or extent of the chemical reactions and pathways by which individual cells transform chemical substances." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0031324', 'negative regulation of cellular metabolic process', '"Any process that stops, prevents, or reduces the frequency, rate or extent of the chemical reactions and pathways by which individual cells transform chemical substances." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0031325', 'positive regulation of cellular metabolic process', '"Any process that activates or increases the frequency, rate or extent of the chemical reactions and pathways by which individual cells transform chemical substances." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0031326', 'regulation of cellular biosynthetic process', '"Any process that modulates the frequency, rate or extent of the chemical reactions and pathways resulting in the formation of substances, carried out by individual cells." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0031327', 'negative regulation of cellular biosynthetic process', '"Any process that stops, prevents, or reduces the frequency, rate or extent of the chemical reactions and pathways resulting in the formation of substances, carried out by individual cells." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0031328', 'positive regulation of cellular biosynthetic process', '"Any process that activates or increases the frequency, rate or extent of the chemical reactions and pathways resulting in the formation of substances, carried out by individual cells." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0032446', 'protein modification by small protein conjugation', '"A protein modification process in which one or more groups of a small protein, such as ubiquitin or a ubiquitin-like protein, are covalently attached to a target protein." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0032496', 'response to lipopolysaccharide', '"Any process that results in a change in state or activity of an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a lipopolysaccharide stimulus; lipopolysaccharide is a major component of the cell wall of gram-negative bacteria." [GOC:add, ISBN:0721601464]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0032501', 'multicellular organismal process', '"Any biological process, occurring at the level of a multicellular organism, pertinent to its function." [GOC:curators, GOC:dph, GOC:isa_complete, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0032502', 'developmental process', '"A biological process whose specific outcome is the progression of an integrated living unit: an anatomical structure (which may be a subcellular structure, cell, tissue, or organ), or organism over time from an initial condition to a later condition." [GOC:isa_complete]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0032504', 'multicellular organism reproduction', '"The biological process in which new individuals are produced by one or two multicellular organisms. The new individuals inherit some proportion of their genetic material from the parent or parents." [GOC:isa_complete, GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0032774', 'RNA biosynthetic process', '"The chemical reactions and pathways resulting in the formation of RNA, ribonucleic acid, one of the two main type of nucleic acid, consisting of a long, unbranched macromolecule formed from ribonucleotides joined in 3'',5''-phosphodiester linkage. Includes polymerization of ribonucleotide monomers. Refers not only to transcription but also to e.g. viral RNA replication." [GOC:mah, GOC:txnOH]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0032989', 'cellular component morphogenesis', '"The process in which cellular structures, including whole cells or cell parts, are generated and organized." [GOC:dph, GOC:mah, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0032990', 'cell part morphogenesis', '"The process in which the anatomical structures of a cell part are generated and organized." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0033036', 'macromolecule localization', '"Any process in which a macromolecule is transported to, or maintained in, a specific location." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0033365', 'protein localization to organelle', '"A process in which a protein is transported to, or maintained in, a location within an organelle." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0033554', 'cellular response to stress', '"Any process that results in a change in state or activity of a cell (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus indicating the organism is under stress. The stress is usually, but not necessarily, exogenous (e.g. temperature, humidity, ionizing radiation)." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0033993', 'response to lipid', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a lipid stimulus." [GOC:sl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0034097', 'response to cytokine', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a cytokine stimulus." [GOC:sl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0034613', 'cellular protein localization', '"Any process in which a protein is transported to, and/or maintained in, a specific location at the level of a cell. Localization at the cellular level encompasses movement within the cell, from within the cell to the cell surface, or from one location to another at the surface of a cell." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0034641', 'cellular nitrogen compound metabolic process', '"The chemical reactions and pathways involving various organic and inorganic nitrogenous compounds, as carried out by individual cells." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0034645', 'cellular macromolecule biosynthetic process', '"The chemical reactions and pathways resulting in the formation of a macromolecule, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass, carried out by individual cells." [CHEBI:33694, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0034654', 'nucleobase-containing compound biosynthetic process', '"The chemical reactions and pathways resulting in the formation of nucleobases, nucleosides, nucleotides and nucleic acids." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0034655', 'nucleobase-containing compound catabolic process', '"The chemical reactions and pathways resulting in the breakdown of nucleobases, nucleosides, nucleotides and nucleic acids." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0035556', 'intracellular signal transduction', '"The process in which a signal is passed on to downstream components within the cell, which become activated themselves to further propagate the signal and finally trigger a change in the function or state of the cell." [GOC:bf, GOC:jl, GOC:signaling, ISBN:3527303782]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0036211', 'protein modification process', '"The covalent alteration of one or more amino acids occurring in proteins, peptides and nascent polypeptides (co-translational, post-translational modifications). Includes the modification of charged tRNAs that are destined to occur in a protein (pre-translation modification)." [GOC:bf, GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0036293', 'response to decreased oxygen levels', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus reflecting a decline in the level of oxygen." [GOC:al]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0040011', 'locomotion', '"Self-propelled movement of a cell or organism from one location to another." [GOC:dgh]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0042060', 'wound healing', '"The series of events that restore integrity to a damaged tissue, following an injury." [GOC:bf, PMID:15269788]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0042127', 'regulation of cell proliferation', '"Any process that modulates the frequency, rate or extent of cell proliferation." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0042221', 'response to chemical', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a chemical stimulus." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0042330', 'taxis', '"The directed movement of a motile cell or organism in response to an external stimulus." [GOC:jl, ISBN:0192801023]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0042384', 'cilium assembly', '"The assembly of a cilium, a specialized eukaryotic organelle that consists of a filiform extrusion of the cell surface. Each cilium is bounded by an extrusion of the cytoplasmic membrane, and contains a regular longitudinal array of microtubules, anchored basally in a centriole." [GOC:kmv, GOC:pr, GOC:vw, ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0042981', 'regulation of apoptotic process', '"Any process that modulates the occurrence or rate of cell death by apoptotic process." [GOC:jl, GOC:mtg_apoptosis]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043043', 'peptide biosynthetic process', '"The chemical reactions and pathways resulting in the formation of peptides, compounds of 2 or more (but usually less than 100) amino acids where the alpha carboxyl group of one is bound to the alpha amino group of another. This may include the translation of a precursor protein and its subsequent processing into a functional peptide." [CHEBI:16670, GOC:dph, GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043062', 'extracellular structure organization', '"A process that is carried out at the cellular level which results in the assembly, arrangement of constituent parts, or disassembly of structures in the space external to the outermost structure of a cell. For cells without external protective or external encapsulating structures this refers to space outside of the plasma membrane, and also covers the host cell environment outside an intracellular parasite." [GOC:ai, GOC:dph, GOC:jl, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043065', 'positive regulation of apoptotic process', '"Any process that activates or increases the frequency, rate or extent of cell death by apoptotic process." [GOC:jl, GOC:mtg_apoptosis]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043066', 'negative regulation of apoptotic process', '"Any process that stops, prevents, or reduces the frequency, rate or extent of cell death by apoptotic process." [GOC:jl, GOC:mtg_apoptosis]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043067', 'regulation of programmed cell death', '"Any process that modulates the frequency, rate or extent of programmed cell death, cell death resulting from activation of endogenous cellular processes." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043068', 'positive regulation of programmed cell death', '"Any process that activates or increases the frequency, rate or extent of programmed cell death, cell death resulting from activation of endogenous cellular processes." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043069', 'negative regulation of programmed cell death', '"Any process that stops, prevents, or reduces the frequency, rate or extent of programmed cell death, cell death resulting from activation of endogenous cellular processes." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043085', 'positive regulation of catalytic activity', '"Any process that activates or increases the activity of an enzyme." [GOC:jl, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043087', 'regulation of GTPase activity', '"Any process that modulates the rate of GTP hydrolysis by a GTPase." [GOC:jl, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043170', 'macromolecule metabolic process', '"The chemical reactions and pathways involving macromolecules, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass." [CHEBI:33694, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043207', 'response to external biotic stimulus', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of an external biotic stimulus, an external stimulus caused by, or produced by living things." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043412', 'macromolecule modification', '"The covalent alteration of one or more monomeric units in a polypeptide, polynucleotide, polysaccharide, or other biological macromolecule, resulting in a change in its properties." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043547', 'positive regulation of GTPase activity', '"Any process that activates or increases the activity of a GTPase." [GOC:jl, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043603', 'cellular amide metabolic process', '"The chemical reactions and pathways involving an amide, any derivative of an oxoacid in which an acidic hydroxy group has been replaced by an amino or substituted amino group, as carried out by individual cells." [CHEBI:32988]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043604', 'amide biosynthetic process', '"The chemical reactions and pathways resulting in the formation of an amide, any derivative of an oxoacid in which an acidic hydroxy group has been replaced by an amino or substituted amino group." [CHEBI:32988]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0043933', 'macromolecular complex subunit organization', '"Any process in which macromolecules aggregate, disaggregate, or are modified, resulting in the formation, disassembly, or alteration of a macromolecular complex." [GOC:mtg_mpo]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044085', 'cellular component biogenesis', '"A process that results in the biosynthesis of constituent macromolecules, assembly, and arrangement of constituent parts of a cellular component. Includes biosynthesis of constituent macromolecules, and those macromolecular modifications that are involved in synthesis or assembly of the cellular component." [GOC:jl, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044093', 'positive regulation of molecular function', '"Any process that activates or increases the rate or extent of a molecular function, an elemental biological activity occurring at the molecular level, such as catalysis or binding." [GO:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044237', 'cellular metabolic process', '"The chemical reactions and pathways by which individual cells transform chemical substances." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044238', 'primary metabolic process', '"The chemical reactions and pathways involving those compounds which are formed as a part of the normal anabolic and catabolic processes. These processes take place in most, if not all, cells of the organism." [GOC:go_curators, http://www.metacyc.org]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044248', 'cellular catabolic process', '"The chemical reactions and pathways resulting in the breakdown of substances, carried out by individual cells." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044249', 'cellular biosynthetic process', '"The chemical reactions and pathways resulting in the formation of substances, carried out by individual cells." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044260', 'cellular macromolecule metabolic process', '"The chemical reactions and pathways involving macromolecules, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass, as carried out by individual cells." [CHEBI:33694, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044265', 'cellular macromolecule catabolic process', '"The chemical reactions and pathways resulting in the breakdown of a macromolecule, any large molecule including proteins, nucleic acids and carbohydrates, as carried out by individual cells." [CHEBI:33694, GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044267', 'cellular protein metabolic process', '"The chemical reactions and pathways involving a specific protein, rather than of proteins in general, occurring at the level of an individual cell. Includes cellular protein modification." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044270', 'cellular nitrogen compound catabolic process', '"The chemical reactions and pathways resulting in the breakdown of organic and inorganic nitrogenous compounds." [GOC:jl, ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044271', 'cellular nitrogen compound biosynthetic process', '"The chemical reactions and pathways resulting in the formation of organic and inorganic nitrogenous compounds." [GOC:jl, ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044699', 'single-organism process', '"A biological process that involves only one organism." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044700', 'single organism signaling', '"A signaling process occurring within a single organism." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044702', 'single organism reproductive process', '"A biological process that directly contributes to the process of producing new individuals, involving a single organism." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044703', 'multi-organism reproductive process', '"A biological process that directly contributes to the process of producing new individuals, involving another organism." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044707', 'single-multicellular organism process', '"A biological process occurring within a single, multicellular organism." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044710', 'single-organism metabolic process', '"A metabolic process - chemical reactions and pathways, including anabolism and catabolism, by which living organisms transform chemical substances - which involves a single organism." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044763', 'single-organism cellular process', '"Any process that is carried out at the cellular level, occurring within a single organism." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044765', 'single-organism transport', '"The directed movement of substances (such as macromolecules, small molecules, ions) into, out of or within a cell, or between cells, or within a multicellular organism by means of some agent such as a transporter or pore, involving a single organism." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044767', 'single-organism developmental process', '"A biological process whose specific outcome is the progression of an integrated living unit: an anatomical structure (which may be a subcellular structure, cell, tissue, or organ), or organism over time from an initial condition to a later condition, involving only one organism." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044770', 'cell cycle phase transition', '"The cell cycle process by which a cell commits to entering the next cell cycle phase." [GOC:mtg_cell_cycle]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044772', 'mitotic cell cycle phase transition', '"The cell cycle process by which a cell commits to entering the next mitotic cell cycle phase." [GOC:mtg_cell_cycle]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044782', 'cilium organization', '"A process that is carried out at the cellular level which results in the assembly, arrangement of constituent parts, or disassembly of a cilium, a specialized eukaryotic organelle that consists of a filiform extrusion of the cell surface. Each cilium is bounded by an extrusion of the cytoplasmic membrane, and contains a regular longitudinal array of microtubules, anchored basally in a centriole." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044802', 'single-organism membrane organization', '"A process which results in the assembly, arrangement of constituent parts, or disassembly of a membrane, involving only one organism." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044839', 'cell cycle G2/M phase transition', '"The cell cycle process by which a cell in G2 phase commits to M phase." [GOC:jl, GOC:mtg_cell_cycle]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0044843', 'cell cycle G1/S phase transition', '"The cell cycle process by which a cell in G1 phase commits to S phase." [GOC:mtg_cell_cycle]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0045047', 'protein targeting to ER', '"The process of directing proteins towards the endoplasmic reticulum (ER) using signals contained within the protein. One common mechanism uses a 16- to 30-residue signal sequence, typically located at the N-terminus of the protein and containing positively charged amino acids followed by a continuous stretch of hydrophobic residues, which directs the ribosome to the ER membrane and initiates transport of the growing polypeptide across the ER membrane." [ISBN:0716731363]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0045087', 'innate immune response', '"Innate immune responses are defense responses mediated by germline encoded components that directly recognize components of potential pathogens." [GO_REF:0000022, GOC:add, GOC:ebc, GOC:mtg_15nov05, GOC:mtg_sensu]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0045184', 'establishment of protein localization', '"The directed movement of a protein to a specific location." [GOC:bf]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0045892', 'negative regulation of transcription, DNA-templated', '"Any process that stops, prevents, or reduces the frequency, rate or extent of cellular DNA-templated transcription." [GOC:go_curators, GOC:txnOH]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0045893', 'positive regulation of transcription, DNA-templated', '"Any process that activates or increases the frequency, rate or extent of cellular DNA-templated transcription." [GOC:go_curators, GOC:txnOH]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0045934', 'negative regulation of nucleobase-containing compound metabolic process', '"Any cellular process that stops, prevents, or reduces the frequency, rate or extent of the chemical reactions and pathways involving nucleobases, nucleosides, nucleotides and nucleic acids." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0045935', 'positive regulation of nucleobase-containing compound metabolic process', '"Any cellular process that activates or increases the frequency, rate or extent of the chemical reactions and pathways involving nucleobases, nucleosides, nucleotides and nucleic acids." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0045944', 'positive regulation of transcription from RNA polymerase II promoter', '"Any process that activates or increases the frequency, rate or extent of transcription from an RNA polymerase II promoter." [GOC:go_curators, GOC:txnOH]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0046483', 'heterocycle metabolic process', '"The chemical reactions and pathways involving heterocyclic compounds, those with a cyclic molecular structure and at least two different atoms in the ring (or rings)." [CHEBI:5686, ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0046700', 'heterocycle catabolic process', '"The chemical reactions and pathways resulting in the breakdown of heterocyclic compounds, those with a cyclic molecular structure and at least two different atoms in the ring (or rings)." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0046777', 'protein autophosphorylation', '"The phosphorylation by a protein of one or more of its own amino acid residues (cis-autophosphorylation), or residues on an identical protein (trans-autophosphorylation)." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0046907', 'intracellular transport', '"The directed movement of substances within a cell." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048232', 'male gamete generation', '"Generation of the male gamete; specialised haploid cells produced by meiosis and along with a female gamete takes part in sexual reproduction." [GOC:dph, GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048285', 'organelle fission', '"The creation of two or more organelles by division of one organelle." [GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048468', 'cell development', '"The process whose specific outcome is the progression of the cell over time, from its formation to the mature structure. Cell development does not include the steps involved in committing a cell to a specific fate." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048513', 'organ development', '"Development of a tissue or tissues that work together to perform a specific function or functions. Development pertains to the process whose specific outcome is the progression of a structure over time, from its formation to the mature structure. Organs are commonly observed as visibly distinct structures, but may also exist as loosely associated clusters of cells that work together to perform a specific function or functions." [GOC:dph, GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048514', 'blood vessel morphogenesis', '"The process in which the anatomical structures of blood vessels are generated and organized. The blood vessel is the vasculature carrying blood." [GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048518', 'positive regulation of biological process', '"Any process that activates or increases the frequency, rate or extent of a biological process. Biological processes are regulated by many means; examples include the control of gene expression, protein modification or interaction with a protein or substrate molecule." [GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048519', 'negative regulation of biological process', '"Any process that stops, prevents, or reduces the frequency, rate or extent of a biological process. Biological processes are regulated by many means; examples include the control of gene expression, protein modification or interaction with a protein or substrate molecule." [GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048522', 'positive regulation of cellular process', '"Any process that activates or increases the frequency, rate or extent of a cellular process, any of those that are carried out at the cellular level, but are not necessarily restricted to a single cell. For example, cell communication occurs among more than one cell, but occurs at the cellular level." [GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048523', 'negative regulation of cellular process', '"Any process that stops, prevents, or reduces the frequency, rate or extent of a cellular process, any of those that are carried out at the cellular level, but are not necessarily restricted to a single cell. For example, cell communication occurs among more than one cell, but occurs at the cellular level." [GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048583', 'regulation of response to stimulus', '"Any process that modulates the frequency, rate or extent of a response to a stimulus. Response to stimulus is a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus." [GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048584', 'positive regulation of response to stimulus', '"Any process that activates, maintains or increases the rate of a response to a stimulus. Response to stimulus is a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus." [GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048585', 'negative regulation of response to stimulus', '"Any process that stops, prevents, or reduces the frequency, rate or extent of a response to a stimulus. Response to stimulus is a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus." [GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048609', 'multicellular organismal reproductive process', '"The process, occurring above the cellular level, that is pertinent to the reproductive function of a multicellular organism. This includes the integrated processes at the level of tissues and organs." [GOC:dph, GOC:jid, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048646', 'anatomical structure formation involved in morphogenesis', '"The developmental process pertaining to the initial formation of an anatomical structure from unspecified parts. This process begins with the specific processes that contribute to the appearance of the discrete structure and ends when the structural rudiment is recognizable. An anatomical structure is any biological entity that occupies space and is distinguished from its surroundings. Anatomical structures can be macroscopic such as a carpel, or microscopic such as an acrosome." [GOC:dph, GOC:jid, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048666', 'neuron development', '"The process whose specific outcome is the progression of a neuron over time, from initial commitment of the cell to a specific fate, to the fully functional differentiated cell." [GOC:dph]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048667', 'cell morphogenesis involved in neuron differentiation', '"The process in which the structures of a neuron are generated and organized. This process occurs while the initially relatively unspecialized cell is acquiring the specialized features of a neuron." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048699', 'generation of neurons', '"The process in which nerve cells are generated. This includes the production of neuroblasts and their differentiation into neurons." [GOC:nln]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048731', 'system development', '"The process whose specific outcome is the progression of an organismal system over time, from its formation to the mature structure. A system is a regularly interacting or interdependent group of organs or tissues that work together to carry out a given biological process." [GOC:dph, GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048812', 'neuron projection morphogenesis', '"The process in which the anatomical structures of a neuron projection are generated and organized. A neuron projection is any process extending from a neural cell, such as axons or dendrites." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048856', 'anatomical structure development', '"The biological process whose specific outcome is the progression of an anatomical structure from an initial condition to its mature state. This process begins with the formation of the structure and ends with the mature structure, whatever form that may be including its natural destruction. An anatomical structure is any biological entity that occupies space and is distinguished from its surroundings. Anatomical structures can be macroscopic such as a carpel, or microscopic such as an acrosome." [GO_REF:0000021, GOC:mtg_15jun06]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048858', 'cell projection morphogenesis', '"The process in which the anatomical structures of a cell projection are generated and organized." [GO_REF:0000021, GOC:mtg_15jun06]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048869', 'cellular developmental process', '"A biological process whose specific outcome is the progression of a cell over time from an initial condition to a later condition." [GOC:isa_complete]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0048870', 'cell motility', '"Any process involved in the controlled self-propelled movement of a cell that results in translocation of the cell from one place to another." [GOC:dgh, GOC:dph, GOC:isa_complete, GOC:mlg]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0050789', 'regulation of biological process', '"Any process that modulates the frequency, rate or extent of a biological process. Biological processes are regulated by many means; examples include the control of gene expression, protein modification or interaction with a protein or substrate molecule." [GOC:ai, GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0050790', 'regulation of catalytic activity', '"Any process that modulates the activity of an enzyme." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0050794', 'regulation of cellular process', '"Any process that modulates the frequency, rate or extent of a cellular process, any of those that are carried out at the cellular level, but are not necessarily restricted to a single cell. For example, cell communication occurs among more than one cell, but occurs at the cellular level." [GOC:go_curators]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0050817', 'coagulation', '"The process in which a fluid solution, or part of it, changes into a solid or semisolid mass." [ISBN:0198506732]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0050877', 'neurological system process', '"A organ system process carried out by any of the organs or tissues of neurological system." [GOC:ai, GOC:mtg_cardio]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0050878', 'regulation of body fluid levels', '"Any process that modulates the levels of body fluids." [GOC:ai, GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0050896', 'response to stimulus', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus. The process begins with detection of the stimulus and ends with a change in state or activity or the cell or organism." [GOC:ai, GOC:bf]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0050953', 'sensory perception of light stimulus', '"The series of events required for an organism to receive a sensory light stimulus, convert it to a molecular signal, and recognize and characterize the signal. This is a neurological process." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0050954', 'sensory perception of mechanical stimulus', '"The series of events required for an organism to receive a sensory mechanical stimulus, convert it to a molecular signal, and recognize and characterize the signal. This is a neurological process." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051171', 'regulation of nitrogen compound metabolic process', '"Any process that modulates the frequency, rate or extent of the chemical reactions and pathways involving nitrogen or nitrogenous compounds." [GOC:ai, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051172', 'negative regulation of nitrogen compound metabolic process', '"Any process that stops, prevents, or reduces the frequency, rate or extent of the chemical reactions and pathways involving nitrogen or nitrogenous compounds." [GOC:ai, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051173', 'positive regulation of nitrogen compound metabolic process', '"Any process that activates or increases the frequency, rate or extent of the chemical reactions and pathways involving nitrogen or nitrogenous compounds." [GOC:ai, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051179', 'localization', '"Any process in which a cell, a substance, or a cellular entity, such as a protein complex or organelle, is transported to or maintained in a specific location." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051234', 'establishment of localization', '"The directed movement of a cell, substance or cellular entity, such as a protein complex or organelle, to a specific location." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051252', 'regulation of RNA metabolic process', '"Any process that modulates the frequency, rate or extent of the chemical reactions and pathways involving RNA." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051253', 'negative regulation of RNA metabolic process', '"Any process that stops, prevents, or reduces the frequency, rate or extent of the chemical reactions and pathways involving RNA." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051254', 'positive regulation of RNA metabolic process', '"Any process that activates or increases the frequency, rate or extent of the chemical reactions and pathways involving RNA." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051259', 'protein oligomerization', '"The process of creating protein oligomers, compounds composed of a small number, usually between three and ten, of component monomers; protein oligomers may be composed of different or identical monomers. Oligomers may be formed by the polymerization of a number of monomers or the depolymerization of a large protein polymer." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051260', 'protein homooligomerization', '"The process of creating protein oligomers, compounds composed of a small number, usually between three and ten, of identical component monomers. Oligomers may be formed by the polymerization of a number of monomers or the depolymerization of a large protein polymer." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051301', 'cell division', '"The process resulting in division and partitioning of components of a cell to form more cells; may or may not be accompanied by the physical separation of a cell into distinct, individually membrane-bounded daughter cells." [GOC:di, GOC:go_curators, GOC:pr]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051336', 'regulation of hydrolase activity', '"Any process that modulates the frequency, rate or extent of hydrolase activity, the catalysis of the hydrolysis of various bonds, e.g. C-O, C-N, C-C, phosphoric anhydride bonds, etc. Hydrolase is the systematic name for any enzyme of EC class 3." [EC:3.-.-.-, GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051345', 'positive regulation of hydrolase activity', '"Any process that activates or increases the frequency, rate or extent of hydrolase activity, the catalysis of the hydrolysis of various bonds." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051641', 'cellular localization', '"A localization process that takes place at the cellular level; as a result of a cellular localization process, a substance or cellular entity, such as a protein complex or organelle, is transported to, and/or maintained in, a specific location within or in the membrane of a cell." [GOC:ai, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051649', 'establishment of localization in cell', '"The directed movement of a substance or cellular entity, such as a protein complex or organelle, to a specific location within, or in the membrane of, a cell." [GOC:ai, GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051674', 'localization of cell', '"Any process in which a cell is transported to, and/or maintained in, a specific location." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051704', 'multi-organism process', '"A biological process which involves another organism of the same or different species." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051707', 'response to other organism', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus from another living organism." [GOC:ai]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0051716', 'cellular response to stimulus', '"Any process that results in a change in state or activity of a cell (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus. The process begins with detection of the stimulus by a cell and ends with a change in state or activity or the cell." [GOC:bf, GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0055085', 'transmembrane transport', '"The process in which a solute is transported from one side of a membrane to the other." [GOC:dph, GOC:jid]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0055114', 'oxidation-reduction process', '"A metabolic process that results in the removal or addition of one or more electrons to or from a substance, with or without the concomitant removal or addition of a proton or protons." [GOC:dhl, GOC:ecd, GOC:jh2, GOC:jid, GOC:mlg, GOC:rph]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0060255', 'regulation of macromolecule metabolic process', '"Any process that modulates the frequency, rate or extent of the chemical reactions and pathways involving macromolecules, any molecule of high relative molecular mass, the structure of which essentially comprises the multiple repetition of units derived, actually or conceptually, from molecules of low relative molecular mass." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0060271', 'cilium morphogenesis', '"A process that is carried out at the cellular level and in which the structure of a cilium is organized." [GOC:BHF, GOC:dph]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0060322', 'head development', '"The biological process whose specific outcome is the progression of a head from an initial condition to its mature state. The head is the anterior-most division of the body." [GOC:dph]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0060548', 'negative regulation of cell death', '"Any process that decreases the rate or frequency of cell death. Cell death is the specific activation or halting of processes within a cell so that its vital functions markedly cease, rather than simply deteriorating gradually over time, which culminates in cell death." [GOC:BHF, GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0060828', 'regulation of canonical Wnt signaling pathway', '"Any process that modulates the rate, frequency, or extent of the Wnt signaling pathway through beta-catenin, the series of molecular signals initiated by binding of a Wnt protein to a frizzled family receptor on the surface of the target cell, followed by propagation of the signal via beta-catenin, and ending with a change in transcription of target genes." [GOC:dph, GOC:sdb_2009, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0061024', 'membrane organization', '"A process which results in the assembly, arrangement of constituent parts, or disassembly of a membrane. A membrane is a double layer of lipid molecules that encloses all cells, and, in eukaryotes, many organelles; may be a single or double lipid bilayer; also includes associated proteins." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0061564', 'axon development', '"The progression of an axon over time. Covers axonogenesis (de novo generation of an axon) and axon regeneration (regrowth), as well as processes pertaining to the progression of the axon over time (fasciculation and defasciculation)." [GOC:dph, GOC:pg, GOC:pr]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0065003', 'macromolecular complex assembly', '"The aggregation, arrangement and bonding together of a set of macromolecules to form a complex." [GOC:jl]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0065007', 'biological regulation', '"Any process that modulates a measurable attribute of any biological process, quality or function." [GOC:dph, GOC:isa_complete, GOC:mah, GOC:pr, GOC:vw]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0065008', 'regulation of biological quality', '"Any process that modulates a qualitative or quantitative trait of a biological quality. A biological quality is a measurable attribute of an organism or part of an organism, such as size, mass, shape, color, etc." [GOC:dph, GOC:isa_complete, GOC:mah, GOC:pr, GOC:vw]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0065009', 'regulation of molecular function', '"Any process that modulates the frequency, rate or extent of a molecular function, an elemental biological activity occurring at the molecular level, such as catalysis or binding." [GOC:isa_complete]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0070271', 'protein complex biogenesis', '"A cellular process that results in the biosynthesis of constituent macromolecules, assembly, and arrangement of constituent parts of a protein complex. Includes the synthesis of non-protein components, and those protein modifications that are involved in synthesis or assembly of the complex." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0070482', 'response to oxygen levels', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a stimulus reflecting the presence, absence, or concentration of oxygen." [GOC:BHF, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0070647', 'protein modification by small protein conjugation or removal', '"A protein modification process in which one or more groups of a small protein, such as ubiquitin or a ubiquitin-like protein, are covalently attached to or removed from a target protein." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0070727', 'cellular macromolecule localization', '"Any process in which a macromolecule is transported to, and/or maintained in, a specific location at the level of a cell. Localization at the cellular level encompasses movement within the cell, from within the cell to the cell surface, or from one location to another at the surface of a cell." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0070887', 'cellular response to chemical stimulus', '"Any process that results in a change in state or activity of a cell (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a chemical stimulus." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0070925', 'organelle assembly', '"The aggregation, arrangement and bonding together of a set of components to form an organelle. An organelle is an organized structure of distinctive morphology and function. Includes the nucleus, mitochondria, plastids, vacuoles, vesicles, ribosomes and the cytoskeleton. Excludes the plasma membrane." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0070972', 'protein localization to endoplasmic reticulum', '"A process in which a protein is transported to, or maintained in, a location within the endoplasmic reticulum." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0071310', 'cellular response to organic substance', '"Any process that results in a change in state or activity of a cell (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of an organic substance stimulus." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0071345', 'cellular response to cytokine stimulus', '"Any process that results in a change in state or activity of a cell (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of a cytokine stimulus." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0071702', 'organic substance transport', '"The directed movement of organic substances into, out of or within a cell, or between cells, or within a multicellular organism by means of some agent such as a transporter or pore. An organic substance is a molecular entity that contains carbon." [CHEBI:50860, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0071704', 'organic substance metabolic process', '"The chemical reactions and pathways involving an organic substance, any molecular entity containing carbon." [CHEBI:50860, GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0071822', 'protein complex subunit organization', '"Any process in which macromolecules aggregate, disaggregate, or are modified, resulting in the formation, disassembly, or alteration of a protein complex." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0071840', 'cellular component organization or biogenesis', '"A process that results in the biosynthesis of constituent macromolecules, assembly, arrangement of constituent parts, or disassembly of a cellular component." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0072358', 'cardiovascular system development', '"The process whose specific outcome is the progression of the cardiovascular system over time, from its formation to the mature structure. The cardiovascular system is the anatomical system that has as its parts the heart and blood vessels." [GOC:mah, UBERON:0004535]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0072359', 'circulatory system development', '"The process whose specific outcome is the progression of the circulatory system over time, from its formation to the mature structure. The circulatory system is the organ system that passes nutrients (such as amino acids and electrolytes), gases, hormones, blood cells, etc. to and from cells in the body to help fight diseases and help stabilize body temperature and pH to maintain homeostasis." [GOC:mah, UBERON:0001009]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0072594', 'establishment of protein localization to organelle', '"The directed movement of a protein to a specific location on or in an organelle. Encompasses establishment of localization in the membrane or lumen of a membrane-bounded organelle." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0072599', 'establishment of protein localization to endoplasmic reticulum', '"The directed movement of a protein to a specific location in the endoplasmic reticulum." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0072657', 'protein localization to membrane', '"A process in which a protein is transported to, or maintained in, a specific location in a membrane." [GOC:mah]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0080090', 'regulation of primary metabolic process', '"Any process that modulates the frequency, rate or extent of the chemical reactions and pathways within a cell or an organism involving those compounds formed as a part of the normal anabolic and catabolic processes. These processes take place in most, if not all, cells of the organism." [PMID:19211694]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0090090', 'negative regulation of canonical Wnt signaling pathway', '"Any process that decreases the rate, frequency, or extent of the Wnt signaling pathway through beta-catenin, the series of molecular signals initiated by binding of a Wnt protein to a frizzled family receptor on the surface of the target cell, followed by propagation of the signal via beta-catenin, and ending with a change in transcription of target genes." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0090150', 'establishment of protein localization to membrane', '"The directed movement of a protein to a specific location in a membrane." [GOC:ascb_2009, GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0090263', 'positive regulation of canonical Wnt signaling pathway', '"Any process that increases the rate, frequency, or extent of the Wnt signaling pathway through beta-catenin, the series of molecular signals initiated by binding of a Wnt protein to a frizzled family receptor on the surface of the target cell, followed by propagation of the signal via beta-catenin, and ending with a change in transcription of target genes." [GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0090304', 'nucleic acid metabolic process', '"Any cellular metabolic process involving nucleic acids." [GOC:dph, GOC:tb]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0097485', 'neuron projection guidance', '"The process in which the migration of a neuron projection is directed to a specific target site in response to a combination of attractive and repulsive cues." [GOC:BHF, GOC:rl, PMID:22790009]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:0097659', 'nucleic acid-templated transcription', '"The cellular synthesis of RNA on a template of nucleic acid (DNA or RNA)." [GOC:pr, GOC:txnOH, GOC:vw]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1901360', 'organic cyclic compound metabolic process', '"The chemical reactions and pathways involving organic cyclic compound." [GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1901361', 'organic cyclic compound catabolic process', '"The chemical reactions and pathways resulting in the breakdown of organic cyclic compound." [GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1901362', 'organic cyclic compound biosynthetic process', '"The chemical reactions and pathways resulting in the formation of organic cyclic compound." [GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1901564', 'organonitrogen compound metabolic process', '"The chemical reactions and pathways involving organonitrogen compound." [GOC:pr, GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1901566', 'organonitrogen compound biosynthetic process', '"The chemical reactions and pathways resulting in the formation of organonitrogen compound." [GOC:pr, GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1901575', 'organic substance catabolic process', '"The chemical reactions and pathways resulting in the breakdown of an organic substance, any molecular entity containing carbon." [GOC:pr, GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1901576', 'organic substance biosynthetic process', '"The chemical reactions and pathways resulting in the formation of an organic substance, any molecular entity containing carbon." [GOC:pr, GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1901700', 'response to oxygen-containing compound', '"Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of an oxygen-containing compound stimulus." [GOC:pr, GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1902578', 'single-organism localization', '"A localization which involves only one organism." [GO_REF:0000089, GOC:jl, PMID:1234]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1902580', 'single-organism cellular localization', '"A cellular localization which involves only one organism." [GO_REF:0000089, GOC:jl, GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1902582', 'single-organism intracellular transport', '"An intracellular transport which involves only one organism." [GO_REF:0000089, GOC:jl, GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1902589', 'single-organism organelle organization', '"An organelle organization which involves only one organism." [GO_REF:0000089, GOC:jl, GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1902679', 'negative regulation of RNA biosynthetic process', '"Any process that stops, prevents or reduces the frequency, rate or extent of RNA biosynthetic process." [GO:jl, GO_REF:0000058, GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1902680', 'positive regulation of RNA biosynthetic process', '"Any process that activates or increases the frequency, rate or extent of RNA biosynthetic process." [GO:jl, GO_REF:0000058, GOC:TermGenie]');
INSERT INTO public.go_biological_process (go_id, name, definition) VALUES ('GO:1903047', 'mitotic cell cycle process', '"A process that is part of the mitotic cell cycle." [GO_REF:0000060, GOC:mtg_cell_cycle, GOC:TermGenie]');
